INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3001, 100, 3001100, 2, 2.1, 1, "2030/01/01 14:59:59", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, "2024/10/31 12:00:00", "ヤマト", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3001, 101, 3001101, 2, 5.68, 4, "2030/01/01 14:59:59", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, "2024/10/31 12:00:00", "ヤマト", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3001, 102, 3001102, 1, 0.0, 1, "2030/01/01 14:59:59", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, "2024/10/31 12:00:00", "ヤマト", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3002, 100, 3002100, 1, 0.0, 1, "2030/01/01 14:59:59", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3002, 101, 3002101, 1, 0.0, 1, "2030/01/01 14:59:59", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3002, 102, 3002102, 2, 8.53, 5, "2030/01/01 14:59:59", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3002, 103, 3002103, 1, 5.67, 7, "2030/01/01 14:59:59", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3002, 104, 3002104, 1, 0.0, 1, "2030/01/01 14:59:59", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3004, 300, 3002300, 3, 0.0, 3, "2030/01/01 14:59:59", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3005, 301, 3002400, 7, 0.0, 7, "2030/01/01 14:59:59", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3003, 200, 3003200, 1, 4.4, 2, "2030/01/01 14:59:59", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3003, 201, 3003201, 7, 0.0, 7, "2030/01/01 14:59:59", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES (-416.5, 3003, 202, 3003202, 2, 5.6, 1, "2030/01/01 14:59:59", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 130211, "2024/10/31 12:00:00", "フブキ", 0.0);
